import "./App.css";

function App() {
  return (
    <div className="App">
      <form action="submit">
        <label htmlFor="input">Name:</label>
        <input type="text" />
        <label htmlFor="input">Age:</label>
        <input type="number" />
        <label htmlFor="input">Country:</label>
        <input type="text" />
        <label htmlFor="input">Position:</label>
        <input type="text" />
        <label htmlFor="input">Wage:</label>
        <input type="number" />
      </form>
    </div>
  );
}

export default App;
